import React, { Component } from 'react'

class RecentTrackListItem extends Component {

    constructor(props) {
        super(props);
    }

  render() {

    const artistArray = this.props.track.artist;
    const albumImageArray = this.props.track.image;
    const mediumImageArray = albumImageArray[0];
    const artistName = artistArray[Object.keys(artistArray)[0]]; 
    const albumImage = mediumImageArray[Object.keys(mediumImageArray)[0]];
    return (
      <li className="top-track">
        <img src={albumImage}/>
        <p>{this.props.track.name} <span className="by">by</span> {artistName}</p> 
      </li>
    )
  }
}

export default RecentTrackListItem;
